[{"operationName":"catalogResultQuery","variables":{"skip":false,"limit":10,"facets":["skillNameMultiTag","jobTitleMultiTag","difficultyLevelTag","languages","entityTypeTag","partnerMultiTag","categoryMultiTag:computer-science","subcategoryMultiTag"],"sortField":"","start":"0"},"query":"query catalogResultQuery($facets: [String!]!, $start: String!, $skip: Boolean = false, $sortField: String, $limit: Int) {
  CatalogResultsV2Resource @skip(if: $skip) {
    browseV2(facets: $facets, start: $start, limit: $limit, sortField: $sortField) {
      elements {
        label
        entries {
          id
          score
          courseId
          specializationId
          onDemandSpecializationId
          resourceName
          __typename
        }
        domainId
        subdomainId
        facets
        courses {
          elements {
            ...FullCourseFragment
            __typename
          }
          __typename
        }
        s12ns {
          elements {
            ...FullS12nFragment
            __typename
          }
          __typename
        }
        __typename
      }
      paging {
        total
        next
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment FullCourseFragment on CoursesV1 {
  ...LightweightCourseFragment
  courseDerivativesV2 {
    skillTags {
      skillName
      relevanceScore
      __typename
    }
    avgLearningHoursAdjusted
    commentCount
    averageFiveStarRating
    ratingCount
    __typename
  }
  __typename
}

fragment LightweightCourseFragment on CoursesV1 {
  id
  slug
  name
  photoUrl
  s12nIds
  level
  workload
  primaryLanguages
  partners {
    elements {
      id
      name
      squareLogo
      classLogo
      logo
      __typename
    }
    __typename
  }
  courseTypeMetadata {
    courseTypeMetadata {
      ...RhymeProjectFragment
      __typename
    }
    __typename
  }
  __typename
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}

fragment FullS12nFragment on OnDemandSpecializationsV1 {
  ...LightweightS12nFragment
  derivativeV2 {
    averageFiveStarRating
    avgLearningHoursAdjusted
    __typename
  }
  courses {
    elements {
      courseDerivativesV2 {
        skillTags {
          skillName
          relevanceScore
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment LightweightS12nFragment on OnDemandSpecializationsV1 {
  name
  id
  slug
  logo
  courseIds
  partners {
    elements {
      id
      name
      squareLogo
      classLogo
      logo
      __typename
    }
    __typename
  }
  metadata {
    headerImage
    level
    __typename
  }
  productVariant
  __typename
}
